DROP DATABASE IF EXISTS goog;

CREATE DATABASE goog;

USE goog;


CREATE TABLE content_rating
(
        content_id                     INT     PRIMARY KEY    NOT NULL       UNIQUE,
    content_rating             varchar(20)
);

CREATE TABLE category
(
        category_id            int     PRIMARY KEY    NOT NULL       UNIQUE,
    category           varchar(50)
);


CREATE TABLE apps
(
        app_id                        INT     PRIMARY KEY    NOT NULL       UNIQUE,
    app_name                   varchar(200),
    category_id                INT     NOT NULL,
    rating                            decimal(10,1),
    reviews                           int,
    size                              varchar(20),
    installs                   varchar(20),
    price                             decimal(5,2),
    content_rating_id  int NOT NULL,
    FOREIGN KEY (category_id) REFERENCES category(category_id),
    FOREIGN KEY (content_rating_id) REFERENCES content_rating(content_id)
    
);

CREATE TABLE apps_reviews
(
        review_id                      INT     PRIMARY KEY    NOT NULL       UNIQUE,
    app_id                            INT     NOT NULL,
    reviews                           text,
    FOREIGN KEY (app_id) REFERENCES apps(app_id)
);




